import React, { useEffect, useState } from "react";
import StandingLine from "./StandingLine";
import ApiManager from "../../api/ApiManager";

function Standings(props) {
    const api = new ApiManager();
    const [standingData, setstandingData] = useState([]);
    const [leagueData, setLeagueData] = useState({});
    const [isLoading, setIsLoading] = useState(true);

    useEffect(() => {
        const fetchStandings = async () => {
            try {
                const responseStanding = await api.makeRequest("standings?league=135&season=2023");
                setstandingData(responseStanding.response[0]?.league?.standings[0] || []);
                setLeagueData(responseStanding.response[0]?.league || {});
                setIsLoading(false);
                console.log("responseStanding:", responseStanding);
            } catch (error) {
                console.log(error);
                setIsLoading(false);
            }
        };

        fetchStandings();
    }, []);

    // Dati fittizi di fallback
    const fallbackData = Array.from({ length: 10 }, (_, index) => ({
        team: { logo: `https://placeholder.com/team${index + 1}`, name: `Team ${index + 1}` },
        all: { win: 0, draw: 0, lose: 0, played: 0 },
        points: 0,
        rank: index + 1,
    }));

    return (
        <>
            <div className="mt-7 flex flex-col gap-2">
                <div className="flex justify-between">
                    <div className="flex gap-5 items-center basis-6/12">
                        <img className="h-6 w-6 rounded-full object-cover" src={leagueData.flag ?? ""} alt="leagueFlag" />
                        <img className="h-8" src={leagueData.logo ?? ""} alt="leagueIcon" />
                        <div className="text-xl font-bold">{leagueData.name ?? ""}</div>
                    </div>
                    <div className="flex items-center basis-3/12 pe-4 text-end">
                        <div className="text-[#6d6a7f] text-sm basis-2/12 ">G</div>
                        <div className="text-[#6d6a7f] text-sm basis-2/12 ">V</div>
                        <div className="text-[#6d6a7f] text-sm basis-2/12 ">N</div>
                        <div className="text-[#6d6a7f] text-sm basis-2/12 ">P</div>
                        <div className="text-[#6d6a7f] text-sm basis-2/12 ">DR</div>
                        <div className="text-sm basis-2/12 font-bold">PT</div>
                    </div>
                </div>
                {isLoading
                    ? fallbackData.map((fakeData, index) => (
                          <StandingLine
                              key={index}
                              teamLogo={fakeData.team?.logo ?? ""}
                              teamName={fakeData.team?.name ?? ""}
                              teamWins={fakeData.all?.win ?? ""}
                              teamDraws={fakeData.all?.draw ?? ""}
                              teamLose={fakeData.all?.lose ?? ""}
                              teamPoints={fakeData.points ?? ""}
                              teamPlayed={fakeData.all?.played ?? ""}
                              number={fakeData.rank ?? ""}
                              teamId={fakeData.team?.id ?? ""}
                          />
                      ))
                    : standingData.map((team, index) => (
                          <StandingLine
                              key={index}
                              teamLogo={team.team?.logo ?? ""}
                              teamName={team.team?.name ?? ""}
                              teamWins={team.all?.win ?? ""}
                              teamDraws={team.all?.draw ?? ""}
                              teamLose={team.all?.lose ?? ""}
                              teamPoints={team.points ?? ""}
                              teamPlayed={team.all?.played ?? ""}
                              number={team.rank ?? ""}
                              teamId={team.team?.id ?? ""}
                          />
                      ))}
            </div>
        </>
    );
}

export default Standings;
